    QDM2Context *s = avctx->priv_data;

    int16_t *out = data;

    int i;



    if(!buf)

        return 0;

    if(buf_size < s->checksum_size)

        return -1;



    av_log(avctx, AV_LOG_DEBUG, "decode(%d): %p[%d] -> %p[%d]\n",

       buf_size, buf, s->checksum_size, data, *data_size);



    for (i = 0; i < 16; i++) {

